import React, { useState } from "react";

function Input() {
  return (
    <div className="input-fields">
      <div className="buttons">
        <button type="button">
          Iš teksto<span>Struktūrizuoti iš teksto</span>
        </button>
        <button type="button">
          Iš nuorodos<span>Struktūrizuoti iš nuorodos</span>
        </button>
        <button type="button">
          Iš failo<span>Struktūrizuoti iš .pdf</span>
        </button>
      </div>
      <div className="input-field">
        <input placeholder=""></input>
      </div>
    </div>
  );
}

export default Input;
